import React, { useState, useEffect } from 'react';
import { Route, Routes, useLocation } from 'react-router-dom';
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import ArtworkList from './components/ArtworkList';
import AdminHomePage from './Admin/AdminHomePage';
import ArtistHomePage from './Artist/ArtistHomePage';
import CuratorHomePage from './Curator/CuratorDashboard';

import Visitorprofile from './Visitor/Visitorprofile';
import CartPage from './components/CartPage';
import AboutPage from './components/About';
import ManageUsers from './Admin/ManageUsers';
import ManageArtworks from './Admin/ManageArtworks';
import SiteSettings from './Admin/SiteSettings';
import ExhibitionHighlights from './Curator/ExhibitionHighlights';
import VisitorFeedback from './Curator/VisitorFeedback';
import ArtworkInsights from './Curator/ArtworkInsights';
import GalleryContentManagement from './Curator/GalleryContentManagement';
import ManageArtworks1 from './Curator/ManageArtworks1';
import OrganizeExhibitions from './Curator/OrganizeExhibitions';

import Navbar from './components/Navbar';
import AdminNavbar from './components/AdminNavbar';
import ArtistNavbar from './components/ArtistNavbar';
import CuratorNavbar from './components/CuratorNavbar';
import AddArtwork from './Artist/AddArts';
import MyArtworks from './Artist/Myartworks';

const App = () => {
  const [cartItems, setCartItems] = useState([]);
  const [userId, setUserId] = useState(null); // Store userId from localStorage
  const [role, setRole] = useState(null); // Store role from localStorage
  const location = useLocation();

  // Retrieve userId and role from localStorage on app mount
  useEffect(() => {
    const storedUserId = localStorage.getItem('userId');
    const storedRole = localStorage.getItem('role');
    setUserId(storedUserId);
    setRole(storedRole);
  }, []);

  // Function to determine which navbar to display based on the current route
  const getNavbar = () => {
    if (location.pathname.startsWith('/admin')) return <AdminNavbar />;
    if (location.pathname.startsWith('/artist')) return <ArtistNavbar />;
    if (location.pathname.startsWith('/curator')) return <CuratorNavbar />;
    return <Navbar />;
  };

  return (
    <div>
      {getNavbar()} {/* Display the appropriate navbar based on the route */}
      <Routes>
        {/* Main Routes */}
        <Route path="/${userId}" element={<Home />} />
        <Route path="/about" element={<AboutPage />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        <Route
          path="/artworks"
          element={<ArtworkList setCartItems={setCartItems} cartItems={cartItems} />}
        />
        <Route
          path="/cart"
          element={<CartPage cartItems={cartItems} setCartItems={setCartItems} />}
        />

        {/* Admin Routes */}
        {userId && role === 'ADMIN' && (
          <>
            <Route path={`/admin/${userId}`} element={<AdminHomePage />} />
            <Route path={`/admin/${userId}/manage-users`} element={<ManageUsers />} />
            <Route path={`/admin/${userId}/manage-artworks`} element={<ManageArtworks />} />
            <Route path={`/admin/${userId}/site-settings`} element={<SiteSettings />} />
          </>
        )}

        {/* Artist Routes */}
        {userId && role === 'ARTIST' && (
          <>
            <Route path={`/artist/${userId}`} element={<ArtistHomePage />} />
            <Route path={`/artist/${userId}/addartwork`} element={<AddArtwork />} />
            <Route path={`/artist/${userId}/myartworks`} element={<MyArtworks />} />
          </>
        )}

        {/* Curator Routes */}
        {userId && role === 'CURATOR' && (
          <>
            <Route path={`/curator/${userId}`} element={<CuratorHomePage />} />
            <Route path={`/curator/${userId}/exhibition-highlights`} element={<ExhibitionHighlights />} />
            <Route path={`/curator/${userId}/visitor-feedback`} element={<VisitorFeedback />} />
            <Route path={`/curator/${userId}/artwork-insights`} element={<ArtworkInsights />} />
            <Route
              path={`/curator/${userId}/gallery-content-manager`}
              element={<GalleryContentManagement />}
            />
            <Route path={`/curator/${userId}/manage-artworks`} element={<ManageArtworks1 />} />
            <Route path={`/curator/${userId}/organize-exhibition`} element={<OrganizeExhibitions />} />
          </>
        )}

        {/* Visitor Route */}
        {userId && role === 'VISITOR' && (
          <Route path={`/${userId}/profile`} element={<Visitorprofile />} />
        )}
      </Routes>

      {/* Footer */}
      <footer style={{ textAlign: 'center', marginTop: '20px', padding: '10px', backgroundColor: '#f8f9fa' }}>
        <p>&copy; {new Date().getFullYear()} Art Gallery. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
